// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

/*
    Контракт с помощью которого работает фугкционал чата
    Владельцем этого контракта является ChatRoomFinance

    Что сделано:
    1 сообщения сохраняются
    2 при отправки сообщения вызывается функция которая принимает оплату из СhatRoomFinance
    3 получение количества сообщений
    4 получение сообщения по индексу

    Что необходимо сделать:
    1 получать сообщения конкретного пользователя
    ...
*/

contract ChatRoom is Ownable {
    //Котракт , который отвечает за менеджмент чата
    address public chatRoomFinance;

    // Структура для хранения информации о сообщении
    struct Message {
        address sender;
        string content;
        uint256 timestamp;
    }

    // Список всех сообщений в чате
    Message[] public messages;

    // Событие для отслеживания отправленных сообщений
    event MessageSent(
        address indexed sender,
        string content,
        uint256 timestamp
    );

    // Инициализация контракта с указанием стоимости сообщения
    constructor(address _chatRoomFinance) Ownable(_chatRoomFinance) {
        require(
            _chatRoomFinance != address(0),
            "ChatRoomFinance address cannot be zero."
        );
        chatRoomFinance = _chatRoomFinance;
    }

    // Функция для отправки сообщения в чат
    function sendMessage(string memory content, uint256 ownerCommissionPercent)
        public
        payable
    {
        require(msg.value > 0, "Message must have a price");

        // Вызов ChatRoomFinance для обработки платежа и распределения средств
        (bool success, ) = chatRoomFinance.call{value: msg.value}(
            abi.encodeWithSignature(
                "processPayment(uint256)",
                ownerCommissionPercent
            )
        );
        require(success, "Payment failed");

        messages.push(
            Message({
                sender: msg.sender,
                content: content,
                timestamp: block.timestamp
            })
        );

        emit MessageSent(msg.sender, content, block.timestamp);
    }

    // Функция для получения количества сообщений в чате
    function getMessageCount() public view returns (uint256) {
        return messages.length;
    }

    // Функция для чтения конкретного сообщения по индексу
    function readMessage(uint256 index)
        public
        view
        returns (
            address,
            string memory,
            uint256
        )
    {
        require(index < messages.length, "Message index out of bounds");
        Message storage message = messages[index];
        return (message.sender, message.content, message.timestamp);
    }
}

